import React from "react";

import "./custom-button.styles.scss";

const CustomButton = ({ children, ...otherProps }) => {
    console.log("button props", ...otherProps);
    return (
        <button className="custom-button" {...otherProps}>
            {children}
        </button>
    );
};

export default CustomButton;
